import React, { useState } from "react";
import "./styles.css";

export default function Navlinks() {
    const values = [
        { id: 1, text: "LI-1" },
        { id: 2, text: "LI-2" },
        { id: 3, text: "LI-3" },
        { id: 4, text: "LI-4" }
    ];
    const [activeId, setActiveId] = useState();

    return (
        <div className="App">
            <ul>
                {values.map((val) => (
                    <li onClick={() => setActiveId(val.id)}>
                        {val.text} -- {activeId === val.id ? "Active" : "Inactive"}
                    </li>
                ))}
            </ul>
        </div>
    );
}
